import React from 'react'
import Card from './Card';
const Tours = (props,removeTour) => {


    return (
        <div >
           <div>
                <h2>Plan of Tour</h2>
           </div>
           <div>
                {
                    props.tours.map( (tour) => {
                        return <Card {...tour} removeTour={removeTour}></Card>
                    } )
                }
           </div>
        </div>
    );
}

export default Tours;
